import Layout from "../components/Layout";
import Link from 'next/link';
import { authInitialProps } from '../lib/auth';

export default function Home(props){
    console.log(props);
    return (
        <Layout title="Home" {...props}>
            <Link href="/profile">
                <a>
                Go to Profile
                </a>
            </Link>
        </Layout>
    )
}
Home.getInitialProps = authInitialProps();
